import React from "react";
import Item from "./Item"

const ItemList=({images})=> {
    const renderList=images.map(img=>{
        return <Item image={img}
                     key={img.id} />
    });
  
        return(
            <div>
                {renderList}
            </div>
        )

 }

 export default ItemList;
